  "text" : "まぁ、 #jawp とかに当てはめたら、それはつまり「記事を編集する人はたくさんいるけど、方針とかテンプレートとか環境整備する人はそんなに多くないので、そういうのをやってくれる人は必要だ」ということだと思う。",
