  "text" : "先日のOSC京都でOSMの人としゃべってた時に聞いたこと「自分は最近あんまり地図本体を投稿してなくて、議論とか周辺整備が中心になってる。けど、地図を作ることは他に人がやってるし、周辺整備みたいなのはやり手が少ないから、自分はそっちで貢献したほうがいいんじゃないかと思っている。」",
