  "text" : "あ、思い出したのでついでに。計算力学やってると対称疎行列かつ正定値な行列を係数とする連立一次方程式の解を求めることはよくあることなので、それをするためだけに特化されたプロセッサなりユニットなりを作ることが出来るなら、そりゃそれを使った方が高速だよね、という話を前にしてました。",
