  "text" : "それはつまり、相談と愚痴の違い、あるいは意見表明と攻撃の違い、もしくは意見とイライラのはけ口の違いです。まぁ誰かを攻撃して自分の精神を安定させる手段はよく使われる手段だし、それを好んだり、そうしないと安定が保てない精神状態なのも知ってるけどね。",
