  "text" : "そういや昔、管水路の損失水頭（エネルギー）を計算する問題で、「へロンの噴水が止まるまでの時間を計算せよ」というレポートがあって、5人（自分含む）と残りの30人以上と答えが違ってて、でも何度計算してもこっちが合ってると思ったのでそのまま出したら、みんな間違ってたということが。",
