  "text" : "まぁ、ついったーの場合は、確かに「流行に踊らされているだけの人（団体も含めて）」も少なくないように思うし、それに加えて、簡単な（ように見える）ものだから、駐輪場の原理も加わって、余計に真剣でないor精査されていない批評が多い気がするのも確か。",
