  "text" : "水文学からすると、「ゲリラ豪雨」というのはなくて、毎年ある「夕立ち」の一種なんだと言ってたのを思い出した。まぁ、怖いイメージを植えつけて避難その他の面でソフト的な対策にはなっているので、良いことではあるのだけど、なんかなぁとか思ってしまう自分。",
